CREATE TABLE MAHASISWA (
    `NPM` INT,
    `nama` VARCHAR(18) CHARACTER SET utf8,
    `username` VARCHAR(13) CHARACTER SET utf8,
    `password` VARCHAR(12) CHARACTER SET utf8,
    `email` VARCHAR(31) CHARACTER SET utf8,
    `email_alternatif` VARCHAR(29) CHARACTER SET utf8,
    `telepon` VARCHAR(15) CHARACTER SET utf8,
    `notelp` VARCHAR(15) CHARACTER SET utf8
);
